import React from "react";
import binaryImage from "../assets/image-binary-code.png"; 
import CategorySubPage from "../components/CategorySubPage";

const BinaryExploitation = () => {
  return (
    <CategorySubPage
      title="Binary Exploitation"
      description="Welcome to the Binary Exploitation category! Here you will find challenges related to Binary security. Test your skills in identifying vulnerabilities, exploiting them, and securing Binary applications."
      imageSrc={binaryImage}
      buttons={[
        { text: "Start Challenges", path: "/Binary-exploitation/challenges" },
      ]}
    />
  );
};

export default BinaryExploitation;
